			shellScript = "RESULTS=./testResults.txt\n\n: > $RESULTS\n\nif [ -e \"$BUILT_PRODUCTS_DIR/cssoptimizer\" ]; then\n\tBINARY=\"$BUILT_PRODUCTS_DIR/cssoptimizer\"\nelse\n\techo \"cssoptimizer binary not found in: $BUILT_PRODUCTS_DIR\"\n\texit 1\nfi\n\nif [ -e ./tmpTest/single_file ]; then\n\techo \"-- Rollink Test --\" >> $RESULTS\n\t\"$BINARY\" ./tmpTest/single_file/rollink.css ./tmpTest/results/rollink_results.css 2>&1 | tee -a $RESULTS\n\n\techo \"-- IE Hack Test --\" >> $RESULTS\n\t\"$BINARY\" ./tmpTest/single_file/hacks.css  ./tmpTest/results/hack_results.css 2>&1 | tee -a $RESULTS\n\n\techo \"-- Standard Funct Test --\" >> $RESULTS\n\t\"$BINARY\" ./tmpTest/single_file/std.css ./tmpTest/results/basic_funct_results.css 2>&1 | tee -a $RESULTS\n\n\techo \"-- Auto-gen Ouput file-name Test --\" >>  $RESULTS\n\tcp ./tmpTest/single_file/std.css ./tmpTest/results/autogen_output_name.css\n\t\"$BINARY\" ./tmpTest/results/autogen_output_name.css 2>&1 | tee -a $RESULTS\n\trm ./tmpTest/results/autogen_output_name.css\n\n\techo \"-- Normal Use With No Options & No input/outputfile --\" >> $RESULTS\n\t\"$BINARY\" 2>&1 | tee -a $RESULTS\n\n\techo $'\\n-- Options w/out input/outputfile --\\n' >>  $RESULTS\n\t\"$BINARY\" -snh 2>&1 | tee -a $RESULTS\n\n\t#echo $'\\n-- inputfile That Doesn't Exist --\\n' >> $RESULTS\n\t#\"$BINARY\" ./tmpTests/notreallyhere.css 2>&1 | tee -a $RESULTS\n\n\techo \"-- Using a directory as the inputfile without -r --\" >>  $RESULTS\n\t\"$BINARY\" ./tmpTest | tee -a $RESULTS\n\n\techo $'\\n-- Test -i Option w/No Input --\\n' >> $RESULTS\n\t\"$BINARY\" -i 2>&1 | tee -a $RESULTS\n\n\techo $'\\n-- Test -io Option\\'s w/No Input --\\n' >> $RESULTS\n\t\"$BINARY\" -io 2>&1 | tee -a $RESULTS\n\n\techo $'\\n-- Test -io Option\\'s w/Input From echo --\\n' >> $RESULTS\n\techo \"test{font-size:10px;}\" | \"$BINARY\" -io 2>&1 | tee -a $RESULTS\n\n\techo $'\\n-- Test -io Option\\'s w/Large Amount of Input From echo --\\n' >> $RESULTS\n\techo \"@import url(\"./header/main.css\");\nbody{background:#d5d6d7;font:62.5% 'Lucida Grande',Verdana,Arial,Sans-Serif;color:#333;text-align:center}\n#page{background:white;border:1px solid #959596;text-align:left}\n#header{background:#73a0c5}#content{font-size:1.2em}\" | \"$BINARY\" -io 2>&1 | tee -a $RESULTS\n\n\techo $'\\n-- Test -o Option --\\n' >> $RESULTS\n\t\"$BINARY\" ./tmpTest/single_file/std.css -o 2>&1 | tee -a $RESULTS\n\n\techo $'\\n-- Test -i Option With a Specified Output File --\\n' >> $RESULTS\n\tcat ./tmpTest/single_file/std.css | \"$BINARY\" -i ./tmpTest/results/from_input_result.css 2>&1 | tee -a $RESULTS\n\n\techo $'\\n-- Test -i & -o Options --\\n' >> $RESULTS\n\tcat ./tmpTest/single_file/std.css | \"$BINARY\" -io 2>&1 | tee -a $RESULTS\n\n\techo $'\\n-- Test -q Option --\\n' >> $RESULTS\n\t\"$BINARY\" ./tmpTest/single_file/std.css ./tmpTest/results/quiet_results.css -q 2>&1 | tee -a $RESULTS\n\n\techo $'\\n-- Test -s Option --\\n' >> $RESULTS\n\tcp ./tmpTest/single_file/std.css ./tmpTest/results/same_file.css\n\t\"$BINARY\" ./tmpTest/results/same_file.css -s 2>&1 | tee -a $RESULTS\n\t\n\techo $'\\n-- Test -r Option With An invalid Directory --\\n' >> $RESULTS\n\t\"$BINARY\" -r ./tmpTest/single_file/std.css 2>&1 | tee -a $RESULTS\n\n\techo $'\\n-- Test -r Option --\\n' >> $RESULTS\n\t\"$BINARY\" -r ./tmpTest/site_test/root_site_dir 2>&1 | tee -a $RESULTS\nelse\n\techo \"Single file test dir does not exist.\"\nfi\n\nopen -a SubEthaEdit $RESULTS\n\nexit 0";
